import React from "react";
import TradingViewWidget, { Themes } from 'react-tradingview-widget';
import "./styles.css"
const ChartPanel = () => {
    return (
        <div className="container">
            <div className="chart-container">
                <TradingViewWidget
                    symbol="NASDAQ:AAPL"
                    locale="fr"
                    autosize
                />
            </div>
            <div className="info-container">
                hell
            </div>
        </div>
    )
}

export default ChartPanel
